import styled from "styled-components"

const CollectionPreview = styled.div`
    max-width: 1440px;
    margin-left: auto;
    margin-right: auto;
    display: grid;
    grid-column-gap: 2.55vw;
    grid-row-gap: 40px;
    -ms-grid-columns: column-start minmax(0,1fr) column-end 2;
    grid-template-columns: repeat(2,column-start minmax(0,1fr) column-end);
    grid-auto-flow: row;
`
export default CollectionPreview
